INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (1, 'film', 'trailers/1.mp4','Холоп',6.8,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1183582.jpg','True',12,'27-летний московский мажор Григорий ошалел от безнаказанности. Богатый папа стабильно его отмазывает, да так, что уже обновил автопарк и оборудование отделению полиции, где служит начальником его друг. После очередной выходки терпение отца иссякает, и он обращается к психологу, практикующему шоковые методы воздействия на пациентов.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (2, 'film', 'trailers/2.mp4','Мажор в Сочи',7.1,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/5078983.jpg','False',16,'Московские массивные здания и оживлённые дороги Мажор сменит на живописные курортные виды, домик в горах и извилистые серпантины. Туда он перебирается вместе с дочерью Соней, где у них появился свой семейный бизнес — эко-отель. Но ещё до открытия всё идёт наперекосяк. Вначале в гостинице устраивают погром, затем Соколовский наткнётся на местного мажора и перейдёт дорогу сочинскому воротиле, который планирует снести целый жилой квартал, чтобы построить на его месте винодельню.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (3, 'film', 'trailers/3.mp4','Майор Гром: Чумной Доктор',7.2,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1109271.jpg','True',12,'Майор полиции Игорь Гром известен всему Санкт-Петербургу пробивным характером и непримиримой позицией по отношению к преступникам всех мастей. Неимоверная сила, аналитический склад ума и неподкупность — всё это делает майора Грома идеальным полицейским. Но всё резко меняется с появлением человека в маске Чумного Доктора. Заявив, что его город «болен чумой беззакония», он принимается за «лечение», убивая людей, которые в своё время избежали наказания при помощи денег и влияния. Общество взбудоражено. Полиция бессильна. Игорь впервые сталкивается с трудностями в расследовании, от итогов которого может зависеть судьба всего города.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (4, 'film', 'trailers/4.mp4','Т-34',6.7,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/930878.jpg','True',12,'В ноябре 1941 года в деревне Нефёдовка вчерашний курсант Николай Ивушкин был вынужден принять командование единственным уцелевшим танком и вступить в неравное противостояние с немецкой танковой ротой, приближавшейся к Москве. Силами противника командовал опытный гауптман Клаус Ягер, но это не спасло его подразделение от поражения, хоть самому ему и удалось ранить нашего курсанта.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (5, 'film', 'trailers/5.mp4','Батя',7.6,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1326397.jpg','True',16,'История о путешествии взрослого героя к своему Бате, суровому русскому мужику, который стал отцом на заре девяностых и воспитывал своего сына так, как это делали все советские люди.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (6, 'film', 'trailers/6.mp4','Легенда №17',8.0,2012,'https://kinopoiskapiunofficial.tech/images/posters/kp/601564.jpg','True',6,'История жизни хоккеиста Валерия Харламова.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (7, 'film', 'trailers/7.mp4','Последний богатырь',7.0,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/976642.jpg','False',12,'Победитель 5-го сезона «Битвы магов» белый маг Святозар, а на самом деле — обычный парень Иван, привычно пудрит мозги телезрителям и доверчивым клиентам, готовым поверить во что угодно. Однажды, спасаясь бегством от крепких охранников мужа очередной одураченной им домохозяйки, парень внезапно переносится из Москвы в сказочную страну Белогорье. А встреченный там старец объявляет Ивану, что тот — сын Ильи Муромца, и только он может их спасти. Так наш «белый маг» оказывается в эпицентре противостояния волшебных сил добра и зла, вот только сам парень уверен, что он тут совершенно ни при чём, и всё это — какая-то нелепая ошибка.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (8, 'film', 'trailers/8.mp4','Мажор. Фильм',6.8,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1445143.jpg','True',16,'Мажор виртуозно сбегает из тюрьмы и начинает новую жизнь. Новую сладкую жизнь! Соколовский вливается в светскую тусовку, где все сидят на новом синтетическом наркотике, и его снова окружают тачки, виллы и топ-модели. Друзья, враги и ФСБ идут по следу Мажора, пытаясь понять, какую игру он затеял и на чьей он стороне. Игорь же пытается понять, кто он сам — предатель, святой или всё тот же… Мажор?');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (9, 'film', 'trailers/9.mp4','Дурак',8.1,2014,'https://kinopoiskapiunofficial.tech/images/posters/kp/808639.jpg','False',16,'Жизни 800 человек общежития висят буквально на волоске из-за безразличия местных властей. В любую секунду здание может рухнуть. И кто бы мог подумать, что судьбы людей окажутся в руках простого сантехника. Но удастся ли ему что-то изменить и предотвратить катастрофу?');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (10, 'film', 'trailers/10.mp4','Три богатыря и Конь на троне',7.4,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/4419497.jpg','True',6,'Как всегда, конь Юлий вляпался в историю. А заодно и Князю удружил — они случайно поменялись телами, конечно, не без помощи старой знакомой — Бабы Яги и небольшого колдовства. Теперь Юлий заседает во дворце и благоустраивает Киев, а Князь пашет поле. Вот такие игры престолов. Но долго так продолжаться не может, отечество в опасности! И как всегда, за дело берутся три богатыря.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (11, 'film', 'trailers/11.mp4','Движение вверх',7.5,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/840817.jpg','True',6,'Есть победы, которые меняют ход истории. Победы духа, победы страны, победы всего мира. Таким триумфом стали легендарные «три секунды» - выигрыш сборной СССР по баскетболу на роковой мюнхенской Олимпиаде 1972 г. Впервые за 36 лет была повержена «непобедимая» команда США. Никто даже помыслить не мог о том, что это возможно – обыграть великолепных непогрешимых американцев на Олимпийских играх! Никто, кроме советских баскетболистов (русских и грузин, украинцев и казахов, белорусов и литовцев).
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (12, 'film', 'trailers/12.mp4','Конёк-Горбунок',6.9,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1045583.jpg','True',6,'Иван — не царевич, не богатырь, не красавец, а старшие братья и вовсе его дураком считают. Но всё меняется, когда у Ивана появляется друг и верный помощник — Конёк-Горбунок. Пусть он ростом невелик, зато умный и смелый. С таким другом никакой враг не страшен. Ну, почти никакой. С таким помощником и ничего невозможного нет. Ну, почти, нет. Ивану с Коньком предстоит проверить свою дружбу на прочность, столкнуться с коварным противником, преодолеть невероятные испытания и встретить такую любовь, ради которой стоит рискнуть всем. Ну, почти всем.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (13, 'film', 'trailers/13.mp4','Я худею',6.9,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/842037.jpg','False',16,'В жизни Ани есть две главные любви – её парень Женя и еда. Из-за еды они и расстаются: Жене совсем не нравится, как Аня стала выглядеть. Аня не готова просто сдаться. При поддержке лучшей подруги и увлечённого здоровым образом жизни добряка Коли она пускается в увлекательное приключение, чтобы похудеть и обрести любовь и счастье.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (14, 'film', 'trailers/14.mp4','Огонь',7.8,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1183599.jpg','True',6,'После гибели подчинённого бывалый инструктор бригады пожарных Алексей Соколов хотел было уволиться, но лето в России — жаркая пора. Взяв в команду шестым нахального новичка, парня своей дочери, Соколов отправляется на очередное задание в Карелию. И это задание будет гораздо сложнее, чем он мог себе представить.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (15, 'film', 'trailers/15.mp4','О чём говорят мужчины',7.8,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/468102.jpg','True',16,'О чем говорят мужчины? Конечно, о женщинах. Нет, еще о работе, о деньгах, о машинах, о футболе,… но в основном, все-таки, о женщинах. А уж если у них впереди два дня, которые они, вырвавшись из офисов и семей, уехав от всех забот и обязательств, проведут в дороге – два дня, насыщенные событиями и приключениями – то можете быть уверены, что за это время они успеют обсудить немало тем…
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (16, 'film', 'trailers/16.mp4','Последний богатырь: Корень зла',7.0,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1249172.jpg','True',6,'Во второй части зрители узнают об истоках древнего зла, с которым героям пришлось столкнуться в первом фильме, увидят новые уголки сказочного Белогорья, и станут свидетелями захватывающих схваток с участием былинных богатырей.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (17, 'film', 'trailers/17.mp4','Балканский рубеж',7.6,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1000443.jpg','True',16,'Югославия. 1999 год. Российская спецгруппа получает приказ взять под контроль аэродром Слатина в Косово и удерживать его до прихода подкрепления. Но этот стратегический объект крайне важен албанскому полевому командиру и натовским генералам. Группа вынуждена принять неравный бой с террористами. К аэродрому устремляются российские миротворцы и силы НАТО. Мир вновь близок к большой войне.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (18, 'film', 'trailers/18.mp4','Непосредственно Каха!',4.3,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1345717.jpg','False',16,'Каха запал на прекрасную Софу, но, чтобы подобраться к её сердцу, ему нужно на своей «копейке» обогнать новенькую BMW Руслана и забить на дружбу с Серго. Что же выберет Каха – любовь или дружбу?');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (19, 'film', 'trailers/19.mp4','Калашников',7.7,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1188248.jpg','True',12,'Калашников. Все знают эту фамилию, но не все знают, какой долгий и тернистый путь прошёл парень-самоучка, чтобы в 28 лет создать легендарный автомат АК-47, который по сей день является символом оружейной мысли нашего времени.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (20, 'film', 'trailers/20.mp4','Три богатыря: Ход конем',5.9,2014,'https://kinopoiskapiunofficial.tech/images/posters/kp/809087.jpg','False',6,'Придворный конь Гай Юлий Цезарь на свою беду подслушивает разговор бояр и узнает о заговоре против князя. Что же делать? Защитить-то князя некому! Богатыри далеко - ловят разбойника Потаню, Горыныч в отпуске, войско на учениях… Но если плохие парни собираются захватить мир, то кому-то же надо его спасти? Кто же он, настоящий герой, который придет на помощь? Конечно, конь Юлий! Настоящий стратег и «великий комбинатор». Он непременно всех спасет, а если не спасет, то хотя бы постарается. Главное, чтобы операция по спасению мира не обернулась полной катастрофой.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (21, 'film', 'trailers/21.mp4','Фиксики: Большой секрет',7.5,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/905038.jpg','True',6,'Фиксики – маленькие добрые человечки, которые живут в машинах и приборах и заботятся о технике. Но люди не должны знать о фиксиках! Это БОЛЬШОЙ СЕКРЕТ! Фиксики находят способ перемещаться по электрическим проводам. Теперь они смогут мгновенно починить любой прибор, где бы он ни был! И тут недоработанное изобретение попадает к озорнику Файеру. В руках маленького фиксика оно становится причиной больших проблем. Искры, взрывы, разрушения, взбесившаяся техника – город на грани катастрофы! Фиксикам почти чудом удаётся её предотвратить. Но как сохранить их БОЛЬШОЙ СЕКРЕТ?!');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (22, 'film', 'trailers/22.mp4','Последний богатырь: Посланник Тьмы',6.8,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1272246.jpg','False',6,'Иван наконец обрел силушку богатырскую, злой чародей Роголеб повержен, и теперь все Белогорье готовится к пиру на весь мир: Иван и Василиса собираются праздновать свадьбу, решая типичные для почти любой пары молодоженов проблемы. В каком платье пойти под венец невесте? Кольца — простые или волшебные? Свадебное путешествие — на куриных ногах или в ступе? В самый разгар приготовлений к празднику зло снова напоминает о себе: Василиса похищена, и в пылу погони Иван и его друзья оказываются в современной Москве. Для жителей Белогорья это — волшебный мир, в котором люди перемещаются на странных колесницах, разговаривают с плоскими дощечками и не в состоянии отличить настоящую магию от дешевой детской игрушки. Но, как выясняется, и в этом мире, бок о бок с обычными людьми, неплохо устроились герои старых сказок, и с их помощью у Ивана есть шанс окончательно победить древнюю Тьму.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (23, 'film', 'trailers/23.mp4','Своя война. Шторм в пустыне',7.4,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1395461.jpg','True',12,'Иван давно вернулся с войны. Но война не отпускает его: он продолжает в нее играть, что уже стоило ему отношений с женой, а теперь может стоить и жизни. Иван отправляется в Сирию под видом иностранного военного корреспондента по имени Джон.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (24, 'film', 'trailers/24.mp4','Мистер Нокаут',7.6,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/1234853.jpg','True',12,'История жизни и приключений легендарного советского боксера Валерия Попенченко, чемпиона СССР, Европы и победителя Олимпийских игр 1964 года в Токио — о его детстве в суворовском училище в Ташкенте, о службе курсантом-пограничником, о его первых успехах и неудачах, и о его дружбе с тренером спортивного общества «Динамо» Григорием Кусикьянцем. История о том, что в любом, даже самом престижном поединке, для спортсмена главное — преодолеть себя, свои страхи и слабости, и только тогда можно будет одержать настоящую победу.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (25, 'film', 'trailers/25.mp4','Битва за Севастополь',7.6,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/742026.jpg','False',12,'Любовь под нескончаемым огнем противника, дружба с Элеонорой Рузвельт, выступление на конференции, повлиявшее на исход Второй мировой войны, желание жить и страх потерять любимого человека - справится ли со всем этим хрупкая женщина?
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (26, 'film', 'trailers/26.mp4','Летчик',7.5,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1405968.jpg','True',12,'Декабрь 1941 года. Летчик Николай Комлев успешно выполняет приказ и уничтожает немецкую танковую колонну, движущуюся к Москве. Но самолет Комлева подбит вражескими истребителями, и летчик чудом сажает свой Ил-2 на глухую лесную поляну. Кажется, самое страшное позади — он выжил в воздушном бою. Однако испытания только начинаются: раненому Комлеву предстоит проделать немыслимый путь, превозмогая мороз, боль и голод, спасаясь от волков и спецотряда нацистов, задача которых — найти его во что бы то ни стало. Летчика ведут воля к жизни, мужество и, конечно, любовь. Дома его ждет Ольга, именно ее образ согревает его в стужу и помогает двигаться вперед, к спасению. У него лишь один шанс выжить, чтобы вернуться к любимой, снова подняться в небо и победить.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (27, 'film', 'trailers/27.mp4','Ёлки',6.9,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/493768.jpg','False',12,'Новогодние события происходят в 11 городах: Калининграде, Казани, Перми, Уфе, Бавлах, Екатеринбурге, Красноярске, Якутске, Новосибирске, Санкт-Петербурге и Москве. Герои фильма — таксист и поп-дива, бизнесмен и актер, сноубордист и лыжник, студент и пенсионерка, пожарный и директриса, вор и милиционер, гастарбайтер и президент России. Все они оказываются в самый канун Нового года в очень непростой ситуации, выйти из которой им поможет только чудо… или Теория шести рукопожатий, согласно которой каждый человек на земле знает другого через шесть знакомых.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (28, 'film', 'trailers/28.mp4','Притяжение',5.7,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/840250.jpg','False',12,'…Как только что стало известно, сбитый над Москвой неопознанный объект имеет, возможно, внеземное происхождение. Большая часть столичного Чертанова оцеплена, к месту крушения стягиваются представители силовых структур, решается вопрос об эвакуации местных жителей. По словам нашего источника в Минобороны сейчас специальная комиссия пытается вступить в контакт с так называемыми «гостями». В эти минуты мы готовим экстренный выпуск новостей, и о развитии событий вы узнаете первыми…');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (29, 'film', 'trailers/29.mp4','Фиксики против кработов',7.9,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1115685.jpg','True',6,'Фиксики – маленькие добрые человечки, которые живут в машинах и приборах и заботятся о технике. От людей фиксики скрываются: в мире есть всего несколько счастливчиков, которые общаются с ними. В лаборатории профессора Чудакова находится школа фиксиков, о которой знают только мальчик ДимДимыч и его подруга Катя. Но однажды там появляются неуловимые существа. Они шпионят за фиксиками и угрожают их тайне. Кто такие эти странные роботы-кработы, что им нужно и кто стоит за ними? Оказывается, у Чудакова есть давний недоброжелатель, и профессора вызывают на дуэль, чтобы свести старые счеты! Новые друзья — Мега и Альт — придут на помощь нашим фиксикам, и все попадут в невероятный водоворот приключений!');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (30, 'film', 'trailers/30.mp4','Домовой',7.3,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1111102.jpg','False',6,'В обычном и суетливом городе Москве есть необычный Дом, обросший сотнями тайн и загадок. В этом доме есть странная квартира, в которой еще надолго не задержался ни один жилец...
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (31, 'film', 'trailers/31.mp4','28 панфиловцев',7.6,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/764465.jpg','True',12,'Осенью 1941-го года немецкие части, стоявшие возле Волоколамска, отделяло от Москвы каких-нибудь два часа по шоссе. Однако, на этом шоссе стояла 316-я стрелковая дивизия под командованием генерала И.В.Панфилова. Этот военачальник обладал настолько высоким авторитетом среди личного состава, что бойцы дивизии сами называли себя панфиловцами. А дивизию - панфиловской.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (32, 'film', 'trailers/32.mp4','Хардкор',7.1,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/778218.jpg','True',18,'Прекрасная супружеская жизнь с очаровательной Эстель – это всё, что помнит Генри после того, как просыпается в научной лаборатории, где его приводит в чувства собственная жена. Но супругу тут же похищают, и ничего непонимающий Генри бросается преследовать монстра Акана, который украл его жену.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (33, 'film', 'trailers/33.mp4','Призрак',7.0,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/839960.jpg','False',6,'Еще вчера Юрий Гордеев — амбициозный авиаконструктор и любимец женщин — был в шаге от своего триумфа. Его самолет ЮГ-1 должен был стать настоящим прорывом в отечественной авиации. Но сегодня его никто не видит и не слышит, и конкурент по бизнесу беспрепятственно закрывает его компанию. Все потому, что Юра разбился в автокатастрофе и стал призраком.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (34, 'film', 'trailers/34.mp4','Конь Юлий и большие скачки',7.3,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1113011.jpg','True',6,'Дождались: говорящий конь Юлий влюбился! И на этот раз все серьезно – он просит руки, то есть копыта​ королевской кобылы по имени Звезда Востока у султана Рашида. 
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (35, 'film', 'trailers/35.mp4','1941. Крылья над Берлином',7.5,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4533880.jpg','False',12,'История о подвиге лётчиков 1-го минно-торпедного авиационного полка ВВС Балтийского флота во главе с полковником Преображенским. У них была сложнейшая боевая задача — нанести первые бомбовые удары по Берлину, столице фашистской Германии.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (36, 'film', 'trailers/36.mp4','Экипаж',7.6,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/839818.jpg','True',6,'Талантливый молодой лётчик Алексей Гущин не признаёт авторитетов, предпочитая поступать в соответствии с личным кодексом чести. За невыполнение абсурдного приказа его выгоняют из военной авиации, и только чудом он получает шанс летать на гражданских самолётах. 
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (37, 'film', 'trailers/37.mp4','Три богатыря и Шамаханская царица',6.9,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/432650.jpg','True',12,'Легендарная Шамаханская царица, которая сводила с ума многих царей и простых смертных, положила свой глаз и на Киевского князя. Тот заболел любовью странной по ней. Но чтобы доставить в целости и сохранности эту чудо-богиню в Киев-Град, срочно из отпуска вызывают всех троих, уже знакомых нам, богатырей: Алёшу Поповича, Добрыню Никитича и Илью Муромца. Теперь троица должна решить, как быть дальше? Вроде бы и слухи о царице ходят нелестные, и князя жаль.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (38, 'film', 'trailers/38.mp4','Солнцепек',6.9,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/4518766.jpg','False',18,'Май 2014 года, Луганск. Та весна выдалась особенно жаркой. Время жить — любовь, счастье и планы на лето. И мечты, которым не суждено сбыться. Лето всё меняет — нечаянное ощущение безысходности и тревоги, неизбежно накрывающее с головой. Хрупкий мир на грани войны. Время, которое полностью перевернет жизнь многих людей.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (39, 'film', 'trailers/39.mp4','Неадекватные люди',7.7,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/542581.jpg','True',16,'Тридцатилетний молодой человек Виталий, убегая от надоедливых проблем и душевного дискомфорта, бросает провинциальный городок Серпухов и переезжает в Москву, надеясь именно здесь найти гармонию с собственным «я». Но до состояния гармонии ему оказывается слишком далеко, ведь впоследствии возникает очень много вопросов, связанных с его новой соседкой Кристиной, которой также не очень везет в жизни и которая пытается «сделать» из него действительно крутого мэна, а также с начальницей, желающей затащить его в кровать. С каждым днем он все больше убеждается в неадекватности подобных людей, которые буквально сорвались с цепи. Но что, если проблема не только в них?');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (40, 'film', 'trailers/40.mp4','Три кота и море приключений',8.5,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/1445170.jpg','False',0,'Коржик, Карамелька и Компот вместе с родителями они отправляются отдыхать на морской курорт, где их ждут яркие события, полные весёлой суматохи и встреч с новыми друзьями.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (41, 'film', 'trailers/41.mp4','Самый лучший день',4.7,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/843784.jpg','False',16,'Успешному сотруднику ДПС Пете Васютину уже давно пора заводить семью, а он живет с мамой, хозяйкой придорожного кафе. И невеста есть — королева бензоколонки, кассирша Оля. В тот самый день, когда Петя решает сделать Оле предложение, в его служебную машину врезается пьяная поп-звезда Алина Шёпот. Чтобы избежать наказания, Алина решает соблазнить Петю.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (42, 'film', 'trailers/42.mp4','Лёд',6.8,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/900052.jpg','True',12,'С самого детства Надя верила в чудеса. Она представляла себе, как выходит на лёд под овации публики и танцует свой самый красивый танец. И вот, благодаря вере и упорству, Надя становится знаменитой фигуристкой. Но когда ее мечты о громких победах, красивой жизни и прекрасном принце уже, кажется, готовы исполниться, судьба преподносит ей настоящее испытание.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (43, 'film', 'trailers/43.mp4','Гром: Трудное детство',7.1,2023,'https://kinopoiskapiunofficial.tech/images/posters/kp/4771048.jpg','False',16,'Юный Игорь Гром ищет варианты срочно заработать большую сумму и ввязывается в сомнительную авантюру на пару с другом Игнатом. Тем временем его отец вместе с будущим начальником петербургской полиции Фёдором Прокопенко охотится за боссом криминального мира по прозвищу Анубис.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (44, 'film', 'trailers/44.mp4','Турист',7.3,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/4446084.jpg','True',18,'Декабрь 2020 года. Бывший сотрудник полиции Гриша Дмитриев в составе небольшой группы российских инструкторов прибывает в Центральноафриканскую Республику. Грише командировка не кажется сложной, ведь в задачи инструкторов входит только обучение солдат местной армии основам тактики и методам ведения боя. Однако все с самого начала идет не так. Несколько бандитских группировок идут на столицу, чтобы устроить в стране государственный переворот. Русские инструкторы совместно со своими подопечными дают отпор бандитам. Но для Гриши, никогда не принимавшего участие в военных действиях, эта командировка превращается в настоящий ад.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (45, 'film', 'trailers/45.mp4','Поиск',7.5,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/970196.jpg','False',16,'16-летняя дочь Дэвида Кима пропадает без следа. Чтобы дать полиции зацепки, отчаявшийся отец взламывает компьютер девочки и понимает, что ничего не знает о собственной дочери.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (46, 'film', 'trailers/46.mp4','Географ глобус пропил',7.4,2013,'https://kinopoiskapiunofficial.tech/images/posters/kp/653696.jpg','True',16,'Молодой биолог Виктор Служкин от безденежья идет работать учителем географии в обычную пермскую школу. Он борется, а потом и дружит с учениками, конфликтует с завучем, ведет десятиклассников в поход - сплавляться по реке. Еще он пьет с друзьями вино, пытается ужиться с женой и водит в детский сад маленькую дочку. Он просто живет...');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (47, 'film', 'trailers/47.mp4','Уроки фарси',7.9,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1209777.jpg','False',16,'1942 год, оккупированная Европа. Оказавшись в концлагере, бельгиец еврейского происхождения Жиль Кремье выдает себя за перса — для него это единственная возможность остаться в живых. Довольные таким редким уловом немецкие солдаты приводят Жиля к концлагерному повару Клаусу Коху, который мечтает, как только закончится война, уехать в Иран и открыть там ресторан. Кох ищет настоящего перса, который научит его говорить на фарси. Так начинается история Жиля Кремье и Клауса Коха — еврея и немца, узника и тюремщика, учителя и ученика.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (48, 'film', 'trailers/48.mp4','Кощей. Начало',7.5,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1243139.jpg','True',6,'В давние времена люди и сказочные существа жили вместе. Пока в Дивноземское княжество не нагрянул Белый призрак, безжалостный монстр, способный уничтожить весь мир. Но лишь одному герою под силу остановить чудище. Он молод, силен, красив, а еще водит байк… Его зовут Кощей.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (49, 'film', 'trailers/49.mp4','Тренер',6.9,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/981230.jpg','True',12,'Футболист национальной сборной Юрий Столешников в ответственный момент не забивает пенальти. После досадной ошибки Столешников покидает сборную, завершает карьеру и становится тренером маленькой провинциальной команды. Именно с этим клубом Столешникову предстоит совершить чудо и вновь поверить в себя.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (50, 'film', 'trailers/50.mp4','Левиафан',6.9,2014,'https://kinopoiskapiunofficial.tech/images/posters/kp/705356.jpg','True',18,'Автослесарь Николай Сергеев живет со второй женой Лилей и сыном от первого брака в маленьком северном городке на берегу моря. Нечистый на руку мэр города Шелевят пытается изъять его дом и землю для собственных нужд. После двух проигранных судов Николай обращается за помощью к бывшему сослуживцу Дмитрию, успешному столичному адвокату. Но приезд московского гостя лишь усложняет и без того непростую жизнь Николая.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (51, 'film', 'trailers/51.mp4','Горько!',5.3,2013,'https://kinopoiskapiunofficial.tech/images/posters/kp/718558.jpg','True',16,'Прогрессивные и талантливые Наташа и Рома мечтают о европейской свадьбе на берегу моря... но у Наташиного отчима заготовлен другой сценарий. Грубый чиновник городской администрации рассматривает торжество как трамплин для собственной карьеры и стремится устроить все «как надо». Молодых ждет незабываемый вечер в ресторане «Золотой» с полным набором занудных обрядов. Не в силах бороться, ребята решают провести свадьбу своей мечты в секрете от консервативных родственников. Но по нелепой случайности оба торжества сливаются воедино.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (52, 'film', 'trailers/52.mp4','Лёд 2',7.2,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1227963.jpg','False',6,'Что происходит в сказках после свадьбы принца и принцессы? Фигуристка Надя и хоккеист Саша поженились и теперь мечтают о ребенке. Правда, цена, которую им придется заплатить за эту мечту, будет невообразимо высока. Кажется, что после таких потрясений рассчитывать на счастливый конец уже невозможно. Но если вы так думаете, вы ничего не знаете о настоящих сказках.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (53, 'film', 'trailers/53.mp4','Метро',7.2,2012,'https://kinopoiskapiunofficial.tech/images/posters/kp/521689.jpg','True',16,'Широко развернувшееся в центре Москвы строительство новых зданий приводит к тому, что в одном из тоннелей метро между двумя станциями возникает трещина. Никто себе и представить не мог, что в результате нарушения герметичности перекрытия в тоннель хлынет вода из Москва-реки, и сотни пассажиров поезда окажутся во власти надвигающегося потопа. Бешеный поток воды грозит не только обрушением тоннелей метро, но и разрушением всего города.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (54, 'film', 'trailers/54.mp4','Брестская крепость',8.0,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/436263.jpg','False',16,'История о героической обороне Брестской крепости, которая приняла на себя первый удар немецко-фашистских захватчиков 22 июня 1941 года. Рассказ о трёх главных очагах сопротивления, возглавляемых командиром полка Петром Гавриловым, комиссаром Ефимом Фоминым и начальником 9-й погранзаставы Андреем Кижеватовым.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (55, 'film', 'trailers/55.mp4','Родные',7.2,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1274271.jpg','False',12,'Узнав о неизлечимой болезни, отец семейства решает исполнить мечту всей жизни: съездить на Грушинский фестиваль и выступить там со своей песней. Семья решает поддержать отца и отправляется в автопутешествие через всю Россию.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (56, 'film', 'trailers/56.mp4','Аритмия',7.7,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/992605.jpg','False',18,'Олег - талантливый врач, работает на «скорой», которая мчится от пациента к пациенту. Олег знает: его приезд может изменить всё. Каждый его успех делает мир лучше. Самое важное — там, где он пытается совершить невозможное. А остальное может подождать: семья, карьера, своя жизнь… Что с ней случилось? Пока Олег спасал других, жена отчаялась и решила подать на развод, а в больнице появился новый начальник, который печётся только о статистике и правилах. А Олег всё спешит с вызова на вызов, несётся по улице, чтобы всё изменить. И кто знает, какая задача легче: спасать других или спасти себя?');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (57, 'film', 'trailers/57.mp4','Как Витька Чеснок вёз Лёху Штыря в дом инвалидов',7.2,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/909700.jpg','True',18,'27-летний Витька Чеснок — парень с детдомовским прошлым, который мечтает сбежать от мешающих ему жить жены и сына. Недолюбленный в детстве и очерствевший сердцем парень встречает отца-уголовника, а теперь ещё и калеку. Витька решает отвезти отца в дом инвалидов, не подозревая, какие приключения и опасности ждут их по дороге.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (58, 'film', 'trailers/58.mp4','Текст',6.9,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1234848.jpg','True',18,'Илья Горюнов семь лет отсидел в тюрьме по ложному обвинению в распространении наркотиков. Теперь он выходит на свободу движимый лишь одним желанием — отомстить тому мажору Петру, который подбросил ему наркотики и поломал жизнь. Встретившись лицом к лицу со своим обидчиком, Илья совершает импульсивный поступок и получает доступ к смартфону Петра, а с ним и к жизни молодого человека — его фотографиям и видео, перепискам с родителями и девушкой Ниной, к странным, полным недомолвок и угроз переговорам с коллегами. На время Илья становится для всех Петром — через текст на экране телефона.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (59, 'film', 'trailers/59.mp4','Иван Царевич и Серый Волк 4',7.6,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1235963.jpg','True',6,'Зима в этом году в тридевятом царстве случилась особенно долгая и холодная. Прямо, как в прошлом году. И как в позапрошлом. Но, вот, пришла весна. Точнее – почти пришла. С вьюгой, морозами и снегом.  Как обычно. И совсем было загрустили наши герои – Иван, Василиса, Серый Волк и Царь-батюшка, если бы вместе с почти-весной, не пришла новость - в Трисемнадцатом царстве пройдет ежегодный всесказочный конкурс песни.  В прошлом году там победил хомяк Жорж, а чей голос окажется круче на этот раз? Царь решил, что Тридевятое царство будет представлять Кот-ученый. Не один все же мультфильм прошли вместе, да и все равно он про книги забыл, орет, точнее поет целыми днями на крышах, как и положено коту в марте. И, конечно, вся компания во главе с Иваном и Волком отправляется поддержать пушистого певца. Ведь свои нужны рядом. А то шоу-бизнес – настоящий серпентарий, и кто знает, какие темные силы стоят за коварными соперниками и их стремлением стать звездой.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (60, 'film', 'trailers/60.mp4','Бабушка лёгкого поведения',5.2,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/981105.jpg','True',16,'Мастер перевоплощений Саня по прозвищу Трансформер провернул кучу афер, точь-в-точь изображая десятки персонажей. Но в этот раз он украл не у тех… Теперь у парня на хвосте очень плохие люди с пистолетами. Саня решает залечь на дно в доме престарелых в образе пожилой тети. И когда ему казалось, что он попал в безвыходную ситуацию, новый поворот судьбы дарит ему любовь и надежду превратиться в приличного человека.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (61, 'film', 'trailers/61.mp4','Ёлки 2',7.0,2011,'https://kinopoiskapiunofficial.tech/images/posters/kp/573817.jpg','True',12,'Незадолго до Нового года Боря теряет память, и единственной зацепкой, которая может помочь, является надпись «З.Г.», которую он обнаруживает на руке. В это же время капитан полиции пытается решить проблемы личного характера и разлучить родную дочь и ее молодого человека, два экстремала и их любимая бабушка из подъезда снова готовятся к членовредительским подвигам, а Вера Брежнева опять сводит с ума сильную половину человечества, а конкретно — рядового Бондарева, бывшего таксиста.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (62, 'film', 'trailers/62.mp4','Красный призрак',7.1,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1115648.jpg','True',16,'Зима 1941 года. Выходя из окружения около Вязьмы, небольшая группа советских солдат вынуждена остановиться в заброшенной деревне. Но передышки не получается. В этом же доме решает обосноваться хорошо вооружённый немецкий отряд во главе с карателем вермахта, который ищет таинственного солдата по прозвищу Красный призрак. Он появляется из ниоткуда, в одиночку убивает захватчиков и так же загадочно исчезает.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (63, 'film', 'trailers/63.mp4','Время первых',7.5,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/885316.jpg','False',6,'1960-е, разгар холодной войны. Две супердержавы - СССР и США - бьются за первенство в космической гонке. Пока СССР впереди, на очереди — выход человека в открытый космос. За две недели до старта взрывается тестовый корабль. Времени на выявление причин нет. Опытный военный лётчик Павел Беляев и его напарник Алексей Леонов, необстрелянный и горячий, мечтающий о подвиге, — два человека, готовые шагнуть в неизвестность. Но никто не мог даже предположить всего, с чем им предстояло столкнуться в полёте. В этой миссии всё, что только могло, пошло не так.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (64, 'film', 'trailers/64.mp4','Полицейский с Рублевки. Новогодний беспредел',6.5,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1161783.jpg','True',16,'В канун нового года отделение полиции «Барвиха Северное» оказывается под угрозой закрытия. Чтобы спасти родной отдел, полицейский с Рублевки Гриша Измайлов вынужден пойти на крайние меры и вместе с оперативниками решает ограбить банк. Он рассчитывает на то, что его коллеги вместе с начальником отдела – Яковлевым легко раскроют это дело, деньги вернут обратно, и все сохранят работу в следующем году. Но все идет не так, как задумал Гриша...');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (65, 'film', 'trailers/65.mp4','Хэппи-энд',7.2,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/994530.jpg','False',12,'Загадочный мужчина приходит в себя на пляже в Таиланде. Он не помнит ни своего имени, ни причины, по которой оказался так далеко от дома. Говорит он только по-русски и отличается крайне скверным характером, однако быстро осваивается на новом месте, налаживает связи и даже организует авантюрный бизнес. И вроде все в его жизни снова благополучно, но один вопрос остается неотвеченным: для чего же он все-таки прилетел на другой конец света?');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (66, 'film', 'trailers/66.mp4','Серебряные коньки',7.6,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1225587.jpg','False',16,'1899 год, рождественский Петербург. Яркая праздничная жизнь бурлит на скованных льдом реках и каналах столицы. Накануне нового столетия судьба сводит тех, кому, казалось бы, не суждено было встретиться. Люди из совершенно разных миров, Матвей — сын фонарщика, его единственное богатство — доставшиеся по наследству посеребренные коньки; Алиса — дочь крупного сановника, грезящая о науке. У каждого — своя непростая история, но, однажды столкнувшись, они устремляются к мечте вместе.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (67, 'film', 'trailers/67.mp4','Иван Царевич и Серый Волк',6.7,2011,'https://kinopoiskapiunofficial.tech/images/posters/kp/406175.jpg','True',0,'Увлекательная история от создателей богатырской трилогии, в которой героев русских народных сказок ждут новые приключения, опасности и забавные ситуации.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (68, 'film', 'trailers/68.mp4','Он — дракон',6.9,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/840258.jpg','True',6,'В разгар свадьбы княжну Мирославу похищает дракон, унося в свой замок на острове. В прошлом остались родные, жених, теперь только каменный плен в компании прекрасного Армана. Но кто он, и как оказался на острове? Мира поймет это слишком поздно: любовь к нему, человеку-дракону, откроет ей горькую истину – любить страшно.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (69, 'film', 'trailers/69.mp4','Монах и бес',7.1,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/742184.jpg','False',12,'Первая половина XIX века. В провинциальном мужском монастыре появляется новый насельник Иван. Местному игумену новенький сразу не нравится, поэтому он начинает давать ему невыполнимые задания. Но Иван легко справляется и просит ещё — кажется, он либо блаженный, либо одержим бесами.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (70, 'film', 'trailers/70.mp4','Рядовой Чээрин',7.3,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/4418992.jpg','True',12,'Глубокая осень 1943 года. Немецкие снайперы хозяйничают на передовой. Молодой охотник Егор Чээрин, только прибывший на фронт, становится снайпером. В первом же бою ему удается проявить себя, он вступает в схватку с немецкими захватчиками и меняет баланс сил на передовой.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (71, 'film', 'trailers/71.mp4','Наша Russia: Яйца судьбы',4.1,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/416090.jpg','True',16,'Рафшан и Джумжуд, гастарбайтеры из Нубарашена, нелегально приезжают в Москву, где бригадир Леонид получил у одного олигарха заказ на супердорогой ремонт. Потеряв в столице «нацайника», Рафшан и Джумжуд пытаются найти и спасти его, сея повсюду разрушения и хаос. Но в самой безнадёжной ситуации судьба поворачивается к гастарбайтерам лицом - Рафшан и Джумжуд узнают страшную тайну, которая изменит всё...');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (72, 'film', 'trailers/72.mp4','Сталинград',5.7,2013,'https://kinopoiskapiunofficial.tech/images/posters/kp/468196.jpg','False',12,'1942-й год. Сталинград. Советские войска планируют контрнаступление на немецкие части, занявшие правый берег Волги. Наступление сорвано. Лишь разведчикам под командованием капитана Громова удается перебраться на другой берег и закрепиться в одном из домов. Им дан приказ удержать его любой ценой. Кроме нескольких чудом уцелевших советских солдат они находят в доме его последнюю жительницу – 19-летнюю Катю.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (73, 'film', 'trailers/73.mp4','Три богатыря на дальних берегах',5.7,2012,'https://kinopoiskapiunofficial.tech/images/posters/kp/592210.jpg','True',0,'На этот раз Алеша Попович, Добрыня Никитич и Илья Муромец, благодаря козням коварной Бабы Яги, оказываются за семью морями на острове, на котором живут туземцы и страшный Гомума. В их отсутствие купец Колыван решают вместе с Бабой-Ягой захватить царство и забрать власть у князя Киевского. На помощь незадачливому правителю приходит конь Юлий, а также жены богатырей и их многочисленные родственники. Словом, богатырей и зрителей ждут приключения на дальних берегах, обыкновенные и невероятные.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (74, 'film', 'trailers/74.mp4','О чём ещё говорят мужчины',6.8,2011,'https://kinopoiskapiunofficial.tech/images/posters/kp/502733.jpg','True',16,'Леша, Слава и Камиль в трудную минуту приходят на помощь своему другу Саше. Накануне Нового года он умудрился вступить в конфликт с женой сотрудника силовых структур, и теперь четверо друзей заперлись в офисе рекламного агентства, которым руководит Саша, пытаясь придумать выход из сложившейся ситуации и коротая время в мужских разговорах.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (75, 'film', 'trailers/75.mp4','Три богатыря и принцесса Египта',5.9,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/1038154.jpg','False',6,'В новогоднюю ночь, в то время, как Князь готовится произнести торжественную речь, а Юлий распаковывает подарки и следит за приготовлением праздничного стола, богатыри едут в гости к Алёше и встречают там странного товарища по имени Дурило. Оказывается, это тринадцатый месяц, который никому особенно не нужен, и который пытается осуществить своё заветное желание – стать самым главным месяцем в году. Только и надо ему, что притвориться Дедом Морозом, показать доверчивому Алёше пару фокусов, подружиться с богатырями и оказаться в Египте – стране фараонов и древних пирамид. А дальше – пирамиды, заклинание, Древний огонь – и дело в шляпе! Но не так-то просто осуществить своё коварное желание, когда на пути у тебя встают не только три богатыря, но и их жёны, Князь и Юлий, Змей Горыныч и Дед Мороз и даже – сама принцесса Нефертити!');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (76, 'film', 'trailers/76.mp4','Духless',6.6,2011,'https://kinopoiskapiunofficial.tech/images/posters/kp/395372.jpg','False',18,'Главный герой фильма - 29-летний топ-менеджер крупного международного банка по имени Макс. Он уверен, что жизнь удалась, ведь у него есть то, о чём многие не могут даже и мечтать: дорогая машина, пентхаус и вечеринки. Свою жизнь Максим тратит на зарабатывание денег, а деньги - на ночные клубы, шикарных девушек, кокаин и прочие атрибуты гламурной жизни. Но в какой-то момент к герою приходит осознание того, что с его жизнью что-то не так. И его мир рушится подобно карточному домику.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (77, 'film', 'trailers/77.mp4','Крым',2.8,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/984364.jpg','True',16,'История о любви, вере и чести, о силе духа и настоящей дружбе на фоне реальных событий крымской весны 2014 года.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (78, 'film', 'trailers/78.mp4','Барбоскины на даче',8.3,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1249181.jpg','False',6,'Нешуточные страсти кипят на обычной даче, где отдыхает семья Барбоскиных. Коварные противники, фантастические изобретения, великосветские интриги, разбитые сердца и даже шпионские тайны. Справиться со всем этим под силу только настоящему индейцу – Малышу.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (79, 'film', 'trailers/79.mp4','Салют-7',7.4,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/893506.jpg','False',12,'Космическая станция «Салют-7», находящаяся на орбите в беспилотном режиме, неожиданно перестаёт отвечать на сигналы центра управления полётами. Принято решение об отправке на орбиту спасательной экспедиции — космический экипаж должен найти «мёртвую» станцию и впервые в мире провести стыковку с 20-тонной глыбой неуправляемого железа.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (80, 'film', 'trailers/80.mp4','Три богатыря и Морской царь',5.8,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/893507.jpg','False',6,'У богатырей семейные неурядицы. Чтобы развеяться, они решают по-быстрому сгонять в Китай за зубом дракона, символом мудрости и силы. В это же время князь Киевский отправляется на прогулку вместе с конем Юлием за сокровищами морского царя, чтобы пополнить казну и «залатать бюджет». Да вот только морской царь решил жениться и для этого утопил Киев. И как теперь быть? Что поможет нашим героям? Дружба, смелость и, конечно, любовь.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (81, 'film', 'trailers/81.mp4','Завод',7.2,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/993591.jpg','False',16,'Прямо посреди дня из своего «мерса» похищен местный олигарх Калугин. Неизвестные в балаклавах потребовали за него большой выкуп. Отвезти деньги берётся глава личной охраны бизнесмена по кличке Туман. Его вооружённые до зубов «спецы» приезжают ночью на завод Калугина, где теперь босса держат в заложниках.
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (82, 'film', 'trailers/82.mp4','Доктор Лиза',8.2,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1254059.jpg','False',16,'Один день из жизни Елизаветы Глинки — филантропа и основательницы фонда «Справедливая помощь». Еще утром она планировала провести его с семьей, отмечая 30-летие свадьбы, но даже сегодня не может отключить телефон. Доктор Лиза должна ехать на вокзал, чтобы накормить бездомных, и к знакомому врачу Шевкунову, чтобы попросить морфин для умирающей девочки. Все это время за ней следят правоохранительные органы, которые давно интересуются этой чрезвычайно энергичной благотворительницей.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (83, 'film', 'trailers/83.mp4','Легенда о Коловрате',6.8,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/844118.jpg','False',12,'XIII век. Русь раздроблена и вот-вот падёт на колени перед ханом Золотой Орды Батыем. Испепеляя города и заливая русские земли кровью, захватчики не встречают серьёзного сопротивления, и лишь один воин бросает им вызов. Молодой рязанский витязь Евпатий Коловрат возглавляет отряд смельчаков, чтобы отомстить за свою любовь и за свою родину. Его отвага поразит даже Батыя, а его имя навсегда останется в памяти народа. Воин, ставший легендой. Подвиг, сохранившийся в веках.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (84, 'film', 'trailers/84.mp4','Финник',7.8,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4742512.jpg','False',6,'Мало кто знает, но в каждом доме живет… свой домовой! Это забавное мохнатое существо тайно обитает в мире людей и хранит домашний очаг. Домовой Финник — добрый, озорной, но немного вредный. Он любит подшутить над жильцами своего дома, поэтому ни одна семья не задерживается в его владениях надолго. Но все меняется, когда в дом въезжают находчивая девочка Кристина и ее родители: на них уловки домового совсем не действуют! Вскоре Кристина знакомится с Финником и узнает тайны жизни домовых. Тем временем, в их городке начинают происходить странные и пугающие события… Отважной девочке и домовому придется стать командой, чтобы разобраться в происходящем и спасти город.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (85, 'film', 'trailers/85.mp4','Анна',6.3,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1049727.jpg','True',18,'Москва, конец 1980-х. Скаут французского модельного агентства находит на Измайловском рынке подходящую ему по всем параметрам девушку Анну. Его не смущает, что потенциальная модель знает несколько языков, но торгует при этом матрёшками, и вот уже Анна летит в Париж и приступает к работе. Но её настоящая работа заключается не в позировании перед фотокамерами — хрупкая девушка работает на КГБ и должна убирать людей по приказу Москвы.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (86, 'film', 'trailers/86.mp4','Подольские курсанты',8.0,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1191022.jpg','True',12,'Октябрь 1941 года, Подмосковье. Около трёх с половиной тысяч курсантов подольских артиллерийского и пехотного училищ получают приказ занять оборону на Ильинском рубеже и совместно с регулярными частями 43-й армии сдерживать наступление фашистских захватчиков, пока не подойдёт подкрепление. Погибая, вчерашние мальчишки держат оборону от многократно превышающих сил немцев и на двенадцать дней становятся преградой на пути врага к Москве.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (87, 'film', 'trailers/87.mp4','Люби их всех',7.2,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1142667.jpg','True',18,'У нее всегда есть план. Для каждого свой. Для каждого свое имя. Одному нужна Вера. Другому — Надежда. И почти всем Любовь. К каждому из мужчин у нее особый подход. Но они всегда платят: и чтобы ее завоевать, и чтобы от нее избавиться. Но кто знает, где кончается обман, на который идут только ради денег, и начинается настоящее чувство? И кто знает кто она: простая столичная содержанка, коварная мошенница, талантливая актриса или женщина, которая умеет (только) любить? Любить их всех.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (88, 'film', 'trailers/88.mp4','Гоголь. Начало',6.2,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/945391.jpg','True',18,'Казаки, ведьмы, русалки, утопленницы и другие обитатели Диканьки встречаются лицом к лицу со своим создателем Николаем Гоголем, молодым писарем из Петербурга, который страдает загадочными припадками и может общаться с персонажами из потустороннего мира. Вместе со своим начальником, блестящим столичным следователем Яковом Гуро, начинающий писатель приезжает на Полтавщину расследовать таинственные убийства девушек. Здесь же он встречает свою любовь, которой суждено сыграть роковую роль в его судьбе. Но хватит ли юному литератору духу противостоять невообразимому? Ведь по слухам, которые активно разносят напуганные местные жители, за преступлениями стоит не кто иной, как сам Дьявол в обличии черного всадника.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (89, 'film', 'trailers/89.mp4','Пара из будущего',6.7,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1405926.jpg','True',12,'2040 год. Евгений и Александра уже 20 лет в браке, их отношения похожи на высохший урюк. Развестись у них тоже не получается, поскольку расторжение брака — очень дорогая процедура. Но судьба дает им шанс: Евгений и Александра попадают в прошлое, в тот самый день 20 лет назад, когда влюбленный Женя сделал предложение прелестной Саше. Теперь пара из будущего решает разлучить самих себя в молодости, но это будет непросто, так как молодые отстаивают свою любовь.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (90, 'film', 'trailers/90.mp4','Этерна: Часть первая',6.2,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4312912.jpg','True',12,'Законный наследник престола в изгнании и сын убитого мятежника — что между ними общего? У каждого своя цель: один мечтает занять трон и вернуть семье былую славу, другой — отомстить убийце отца, который служит узурпаторам. Юноши вступают в масштабную борьбу за власть и честь, в которой те, кто казались друзьями, могут предать, а былые враги превратиться в союзников. Ради достижения цели и принцу, и сыну бунтовщика придется рискнуть самым ценным и сделать главный выбор в своей жизни — пойти предначертанным путем или выступить против самой судьбы.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (91, 'film', 'trailers/91.mp4','Бендер: Начало',6.9,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1305913.jpg','True',16,'1919 год. Судьба сталкивает юного идеалиста Осю с турецко-подданным аферистом Ибрагимом Бендером. И никогда бы честный Ося не связался с таким бессовестным и хитроумным мошенником, если бы их не объединила невероятно опасная авантюра — охота за царской реликвией, драгоценным жезлом, заполучить который также не прочь местные бандиты и белые офицеры. В череде головокружительных приключений Ося вынужден учиться у Ибрагима обаятельной лести, деликатному обману, пленительному шантажу и… грубой силе. И все это — будучи влюбленным в самую чистую девушку города! И, кажется, еще в одну — роковую иностранную красотку… 
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (92, 'film', 'trailers/92.mp4','Громкая связь',7.0,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1142619.jpg','False',18,'Семеро друзей, собравшись в загородном доме, в шутку начинают игру — участники должны зачитывать вслух все приходящие им сообщения, а на звонки отвечать только по громкой связи. Они и представить себе не могли, какие удивительные открытия им предстоит сделать друг о друге.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (93, 'film', 'trailers/93.mp4','Семейный бюджет',6.3,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1301880.jpg','False',12,'Фроловы — дружная семья из Краснодара. Мама — преподавательница по фортепиано, папа — конструктор аттракционов, дочь-блогер и сын-романтик, как и многие, они покупают квартиру в ипотеку. Однако скоро оказывается, что платить за неё нечем. Теперь, чтобы не остаться на улице, Фроловы идут на всё.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (94, 'film', 'trailers/94.mp4','Викинг',4.6,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/707407.jpg','True',18,'Раннее Средневековье. Время тяжелых мечей и темных законов крови. Правящий род в раздоре. Вина за случайную смерть брата легла на Великого князя, и по закону мстить ему должен младший брат — бастард. За отказ убивать он заплатит всем, что у него было, потому что «для мира нужно больше мечей, чем для войны».');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (95, 'film', 'trailers/95.mp4','Ёлки 3',6.5,2013,'https://kinopoiskapiunofficial.tech/images/posters/kp/652659.jpg','True',6,'Спустя два года они снова с нами: любимые герои «Ёлок» в самых невероятных новогодних историях. Боря и Женя, чьи годовалые дети в канун праздника доведут друзей до психушки. Маленькая девочка Настя, чьи родители разлучат ее влюбленных друг в друга собак. Лыжник и сноубордист в самой экстремальной в их жизни гонке – от военкома. И профессор из Екатеринбурга Андрей, чья любвеобильность вновь не доведет его до добра, а только до проруби в минус 30. 
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (96, 'film', 'trailers/96.mp4','Самый Новый год!',6.9,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1445155.jpg','False',16,'У Саши три проблемы: девушка, которая хочет свадьбу, на которую он никак не может решиться, ведь он всего-навсего ветеринарный фельдшер и чистит уши собакам, родители, ведь маме не нравится Оля, а папе не нравится его работа, потому что Саша чистит уши собакам, и третья - он не нравится Олиной маме, потому что... да, потому что он чистит уши собакам. 
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (97, 'film', 'trailers/97.mp4','Казнь',7.5,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1405778.jpg','True',18,'1991 год. В деле о серийных убийствах в провинциальном городке, которое расследовалось долгие 10 лет и было официально закрыто, внезапно появляется новое обстоятельство — выжившая жертва. Следователь по особо важным делам Исса Давыдов, который за закрытие дела получил повышение, вынужден срочно разобраться в ситуации и оправдаться перед начальством, под давлением которого он закрыл глаза на несостыковки и недостаточность улик. Он решает во что бы то ни стало исправить свою ошибку и сделать всё возможное, чтобы маньяк признался в убийствах.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (98, 'film', 'trailers/98.mp4','Ночная смена',6.5,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1045170.jpg','True',18,'Макс теряет работу на заводе и, чтобы прокормить семью, вынужден согласиться на неожиданное предложение бывшей одноклассницы – поработать стриптизером. Скрывая новую профессию от жены Ани, Макс попадает в массу удивительных и нелепых ситуаций и в итоге теряет доверие любимой женщины. Стремясь вернуть мир и гармонию в семью, он обращается за помощью к коллегам из стрип-клуба, что и вовсе приводит к веселому хаосу...');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (99, 'film', 'trailers/99.mp4','Нелюбовь',7.5,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/963346.jpg','True',18,'Московская семья переживает мучительный развод. Женя и Борис – ещё супруги, но каждый из них уже фактически начал новую главу жизни, и потому им не терпится покончить с формальностями и развестись. В череде конфликтов и бесконечных взаимных претензий Женя и Борис пренебрегают своим единственным ребенком, 12-летним Алёшей, который чувствует абсолютную ненужность обоим родителям. После очередной ссоры Алёша исчезает.');
INSERT INTO content(id,type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (100, 'film', 'trailers/100.mp4','Каникулы президента',6.1,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1047726.jpg','False',16,'Устав от рутины, Президент решает отправиться на каникулы в гордом одиночестве, чтобы отдохнуть в Крыму, а заодно свободно пообщаться с народом. Понимая, что остаться инкогнито и улизнуть от заботливых коллег будет сложно, он прибегает к услугам гримера. Но его новый облик точь-в-точь совпадает с наружностью Валерия из N-ска, который скрывается от коллекторов по путевке матери в крымском санатории…');
