INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (101, 'series','trailers/1.mp4','Триггер',8.5,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1100777.jpg','False',18,'Психолог Артём Стрелецкий — сторонник шоковой терапии в лечении больных. Он считает, что единственный способ для человека решить свои проблемы — это понять себя и перестать себе врать. Если большинство психологов нянчатся с клиентами, по полгода выслушивают жалобы на жизнь, сочувствуют и получают при этом немалые деньги за цикл сеансов, то Артём постоянно провоцирует клиентов: оскорбляет их, смеется над ними, намеренно выталкивает из зоны комфорта. Практика Артема процветает, пока один из его пациентов не кончает жизнь самоубийством.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (102, 'series','trailers/1.mp4','Мажор',8.2,2014,'https://kinopoiskapiunofficial.tech/images/posters/kp/820638.jpg','True',16,'Таких, как наш главный герой Игорь Соколовский, то есть детей высокопоставленных, богатых родителей, называют мажорами. Наш герой имеет юридическое образование, но ни одного дня не проработал. Безответственный прожигатель жизни. В один из загулов ночью он вступился за приятеля, подрался с полицейскими, выбил табельное оружие у офицера... В итоге отец лишает героя всего и отправляет работать в отделение полиции - то самое, в котором служат ночные полицейские. Его, мажора, там не ждут. Его презирают. Но именно там он начнет становиться мужчиной, встретит свою любовь и найдет убийцу мамы.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (103, 'series','trailers/1.mp4','Беспринципные',7.7,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1355059.jpg','False',18,'Добро пожаловать на Патриаршие. Смешные и волнующие подробности личной жизни богатых москвичей, которые, как и все, попадают в неловкие ситуации. Правда, ситуации у них не самые обычные... Жена чувствует себя виноватой, познакомившись с любовницей мужа. Муж прикрывается выдуманной дочерью друга. А друг толкает помощника на измену, потому что так хочет жена. И это только начало. Одним словом, неприличные истории о приличных, казалось бы, людях.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (104, 'series','trailers/1.mp4','Монастырь',7.4,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/5079093.jpg','False',18,'Мария — обаятельная тусовщица, которая живёт за чужой счёт. Однажды в Эмиратах она едет в ночной клуб вместе с женой миллиардера, вечеринка выходит из-под контроля, и теперь Марии грозит тюрьма, её преследуют опасные люди, а счета оказываются заблокированы. Приходится бежать в Россию, но и дома она не в безопасности — и девушка укрывается в стенах монастыря.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (105, 'series','trailers/1.mp4','Вампиры средней полосы',8.3,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1224067.jpg','True',18,'Смоленск — среднестатистический город средней полосы России. Но не совсем. Много веков тут живут вампиры, которые хоть и позволяют себе охотиться на людей, но всё же свято чтут договор, по которому за каждое убийство нужно отдать хранителям на казнь одного из своих. Когда в березовой роще под Смоленском находят обескровленных парней, их мирная жизнь оказывается под угрозой. Теперь местной вампирской ячейке общества под руководством самого старого вампира деда Славы, он же — Святослав Вернидубович, предстоит в кратчайшие сроки найти нарушителя спокойствия.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (106, 'series','trailers/1.mp4','Топи',6.9,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1355060.jpg','False',18,'Столкнувшись с неразрешимыми проблемами, пять молодых москвичей убегают в монастырь неподалеку от полузаброшенной деревни Топи. Они воспринимают поездку как приключение, долгожданную свободу от забот и возможность забыться. Однако путешествие оборачивается чередой загадочных событий, которые лишь приближают то, от чего они бежали, и заставляют сомневаться в реальности происходящего.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (107, 'series','trailers/1.mp4','Пищеблок',7.2,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1405843.jpg','True',18,'Пока вся страна следит за Олимпиадой-80, в пионерском лагере «Буревестник» на Волге происходят странные события. Дети загадочно исчезают по ночам, а потом возвращаются — но совсем не такими, как прежде. Увлеченные летней свободой и друг другом вожатые не замечают, как в их отрядах оживают страшные пионерские легенды, а руководство лагеря делает вид, что все в порядке. Разбираться в тайнах «Буревестника» придется мальчику Валерке и вожатому Игорю. Для начала им предстоит понять, остался ли в лагере хоть кто-то, кому можно доверять.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (108, 'series','trailers/1.mp4','Два холма',7.4,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4531254.jpg','False',18,'Что будет, если в результате биологической войны почти все мужское население вымрет? Женщины погорюют (недолго), а потом объединятся и создадут новый лучший мир — с экогородками, возобновляемой энергией, возможностями заниматься чем захочется, хоть наукой и биохакингом, хоть йогой и саморазвитием. Размножение теперь происходит путем искусственного оплодотворения, а рождаются в новом мире только девочки. \n\nНо не всем по нраву такое мироустройство. Часть оставшихся в живых мужчин и верных им женщин уходят жить в заброшенные мегаполисы, начинают воровать электричество, наслаждаясь свободой и традиционным сексом. Спокойствие идеально устроенного женского мира оказывается под угрозой, когда учительница Рада из экогорода «Два холма» встречает за его пределами молодого «примата» Геру.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (109, 'series','trailers/1.mp4','Проект «Анна Николаевна»',7.5,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1322389.jpg','False',18,'Отечественные учёные создали андроида-полицейского. Идеальная во всех отношениях капитан Анна Николаевна Королькевич отправляется служить в провинциальный город, чтобы увидеть реальную жизнь и стать похожей на человека. Коллеги думают, что Анна Николаевна — дочь замминистра, и ничто не предвещает беды, пока очеловечивание не заходит слишком далеко.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (110, 'series','trailers/1.mp4','Нулевой пациент',8.4,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4642708.jpg','True',18,'1988 год, Калмыцкая АССР. Молодой врач детской больницы Кирсан Аюшев подозревает, что у нескольких его пациентов ВИЧ. Старшие коллеги не верят, что такое возможно, поэтому Кирсан тайком отправляет пробы в Москву. Когда анализы подтверждают его правоту, к делу подключается ученый Дмитрий Гончаров — специалист по малоизвестной в СССР «экзотической» болезни. Теперь судьба десятков детей и нескольких взрослых — а, возможно, и всей страны — зависит от действий столичного эпидемиолога и провинциального педиатра.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (111, 'series','trailers/1.mp4','Кухня',8.2,2012,'https://kinopoiskapiunofficial.tech/images/posters/kp/687595.jpg','True',16,'«Во все времена еда была рядом с людьми. Она искушает, вдохновляет, восхищает, отвращает. Но человек не может без еды, а значит тот, кто создает еду, может управлять миром...». Так думал Максим Лавров, когда шел осуществлять свою мечту – устраиваться поваром в один из самых дорогих ресторанов столицы.\n\nМечта сбылась, вот только на деле все вышло не так вкусно. Шеф-повар ресторана Виктор Баринов – настоящая звезда гастрономического бомонда, знающая как угодить взыскательной публике. Оборотная сторона этого идеального образа – злоупотребление алкоголем, страсть к азартным играм и невыносимый характер. В гневе Баринов страшен, в загуле – неукротим.\n\nАрт-директор Виктория Гончарова – настоящая снежная королева, карьеристка с ледяным сердцем, однако именно с ней Макс проводит ночь до того, как пойти на новую работу. А вся команда поваров только и ждет промашки новичка, чтобы от души посмеяться.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (112, 'series','trailers/1.mp4','Полицейский с Рублёвки',8.0,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/913033.jpg','False',16,'«Полицейский с Рублёвки» — это история о Грише Измайлове, полицейском, который призван охранять покой и порядок в самом элитном районе России, где живут невероятно богатые люди. Ему приходится расследовать дела, в которые впутываются жители Рублевки, и делает он это нередко превышая свои полномочия. Грише около 30 лет, он красив, одинок, богат, циничен, азартен и ко всему относится с изрядной долей черного юмора. Он заботится о младшей сестре-хулиганке, которую вынужден постоянно вытаскивать из неприятностей. Гриша не прикладывая усилий умеет нравиться женщинам и регулярно издевается над своим начальником Яковлевым.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (113, 'series','trailers/1.mp4','Фиксики',7.3,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/581653.jpg','True',0,'«А кто такие фиксики — большой-большой секрет!» — так поётся в песенке про фиксиков. До недавнего времени люди почти ничего не знали об этих маленьких человечках, которые живут внутри машин и приборов. Фиксики ухаживают за техникой изнутри, чистят её, смазывают, устраняют мелкие поломки. Они — умелые и добросовестные мастера. Фиксики привыкли скрываться от людей, но есть они повсюду: в компьютерах, холодильниках, телевизорах... Каждый помнит о случаях, когда неработающий прибор начинал вдруг работать, если по нему слегка стукнуть. Всё просто: внутри проснулся фиксик и всё наладил. А теперь об этих таинственных трудолюбивых человечках можно посмотреть мультфильмы и познакомиться с ними поближе...');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (114, 'series','trailers/1.mp4','Конец света',7.4,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4642803.jpg','False',18,'В районе Чертаново, известном периодическими вторжениями и притяжениями, внезапно объявляется сам Князь Тьмы. У него грандиозные планы, но для их реализации ему нужна помощь сына — кассира супермаркета, который к отцу из преисподней имеет массу вопросов. Всевластному Князю Тьмы придётся строить отношения с земными родственниками, чтобы осуществить задуманное и преподать урок человечеству.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (115, 'series','trailers/1.mp4','Закрыть гештальт',7.7,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4642651.jpg','False',18,'Чудом уцелев после падения с 20-го этажа, менеджер автосалона Фёдор Ярцев обретает необычный дар: теперь он видит призраков. Злопамятная теща и школьный физрук, бандит из девяностых и пожилая интеллигентка — кто только не будет донимать Федора своими незаконченными делами. Даже его собственный юный отец, пропавший в 20 лет. Фёдор станет невольным посредником между мирами и поможет заблудшим душам отправиться куда следует. А заодно наладит отношения с папой, которого прежде не знал, и закроет гештальты, о существовании которых даже не подозревал.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (116, 'series','trailers/1.mp4','Метод',8.1,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/838050.jpg','False',18,'Родион Меглин — загадочная и неординарная личность, следователь высочайшего уровня, который раскрывает самые сложные убийства. Он привык работать в одиночку, не раскрывая секреты своего метода.\n\nВыпускница юрфака Есеня становится стажером Меглина. У девушки есть личные мотивы для работы с прославленным следователем — мать Есени убили, а отец скрывает важные детали произошедшего, но она не оставляет надежды выйти на след убийцы.\n\nРабота с Меглиным становится для Есени тяжелым испытанием. Профессиональные успехи и странное поведение учителя заставляют девушку задуматься: если Родион так тонко чувствует маньяков и может предсказать их действия, не является ли он сам одним из них?');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (117, 'series','trailers/1.mp4','За час до рассвета',7.5,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1338342.jpg','False',16,'1946 год. Капитан Денис Журавлёв возвращается к мирной жизни и устраивается на службу в милицию. Его начальник — майор Шумейко по прозвищу Сатана — человек с тяжёлым характером, но решения поставленных задач добивается любой ценой. Журавлёв появляется в команде как раз вовремя: в городе орудует банда преступника по прозвищу Клещ, и, чтобы поймать его, нужен неординарный план, который Журавлёв берётся реализовать. Однако скоро становится очевидно, что война, идущая в мирное время, когда непонятно, кто друг, а кто враг, ещё запутаннее, чем война, с которой он только что вернулся.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (118, 'series','trailers/1.mp4','Контейнер',7.8,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/2000034.jpg','True',18,'Вопреки общей практике суррогатная мать Саша переезжает в дом своих заказчиков и оказывается в совершенно чуждом ей мире — особняке богатого чиновника Вадима и его жены Марины. Саша для них — «контейнер», новая игрушка. Однако то, что в начале казалось заботой о будущем ребенке, вскоре оборачивается испытаниями для каждого из жильцов.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (119, 'series','trailers/1.mp4','Трудные подростки',8.1,2019,'https://kinopoiskapiunofficial.tech/images/posters/kp/1311936.jpg','False',18,'Популярный футболист Антон Ковалёв, отсидев два года в тюрьме за пьяный дебош в кафе, выходит на свободу. Проступок перекрыл успешную карьеру Ковалёва, который ранее был капитаном сборной России. Репутация «сбитого летчика» не позволяет ему продолжить любимое дело и получить престижную работу. Некогда воспитывавший Антона глава центра трудных подростков Герман предлагает ему место в центре, чтобы подготовить непростых ребят к местной Олимпиаде. От безысходности Ковалев соглашается на предложение, но даже не представляет, насколько сложно будет найти общий язык с ребятами, и какое важное место они могут занять в его жизни.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (120, 'series','trailers/1.mp4','Медиатор',8.1,2021,'https://kinopoiskapiunofficial.tech/images/posters/kp/1395460.jpg','True',18,'Андрей Павлов — профессиональный переговорщик, прошедший подготовку в Академии Управления МВД России. Он тот человек, который без оружия приходит к террористам и в считанные секунды устанавливает с ними контакт. Но основной его доход идет не от удачного освобождения заложников, а от крупного бизнеса. Везде, где люди не могут договориться, он помогает — за очень большие деньги. Для каждого случая он меняется до неузнаваемости. Удивительную способность к перевоплощению Павлов развил в детстве — это помогало ему выстраивать непростые отношения с матерью. А еще он настолько хорошо чувствует людей, что давно не верит никому. Даже себе.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (121, 'series','trailers/1.mp4','Три кота',8.0,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/935898.jpg','False',0,'Три кота — история о повседневной жизни, отношениях и приключениях трех маленьких любознательных котят Коржика, Компота и Карамельки. В их большой семье жизнь никогда не стоит на месте: вместе они учатся выражать эмоции, поддерживать друг друга и находить выход из любой, даже непростой на первый взгляд ситуации, при помощи фантазии и родительского совета.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (122, 'series','trailers/1.mp4','Простоквашино',7.6,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1115407.jpg','False',0,'Казалось, никакие бури внешнего мира не смогут поколебать привычный и размеренный ход деревенской жизни Простоквашино. Время как будто застыло. Все так же каждое утро Матроскин дегустирует свежее молоко, полученное от своей любимицы - коровы Мурки. Все так же Шарик проводит время в окрестных лесах, «фотоохотясь» на редкую дичь. Правда, теперь он научился выкладывать фотографии своей добычи в интернет. И все так же, при каждой возможности, их навещает Дядя Федор. И тогда они весело и дружно проводят время своей мужской компанией. И когда им уже стало казаться, что так будет всегда, внезапно все изменилось с появлением одной маленькой девочки, родной сестры Дяди Фёдора. И имя этой девочки – Вера Павловна.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (123, 'series','trailers/1.mp4','Барбоскины',6.6,2011,'https://kinopoiskapiunofficial.tech/images/posters/kp/592212.jpg','True',0,'Мама, папа и… пятеро щенят. У Барбоскиных все, как у людей. Папа свободное время проводит за компьютером, дочери увлекаются модой и слушают Жанну Киску, а сыновья играют в футбол и мечтают о Нобелевской премии.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (124, 'series','trailers/1.mp4','Интерны',7.4,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/501998.jpg','False',16,'Интерны все время попадают в идиотские ситуации, а их руководитель доктор Быков с удовольствием за этим наблюдает.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (125, 'series','trailers/1.mp4','Метод 2',7.0,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1238997.jpg','False',18,'После смерти Меглина прошел год, но Есеня не может забыть о том, что произошло. Не может и не хочет. Призраки прошлого снова и снова возвращают её в тот день, когда она потеряла Меглина.\n\nЕсеня пытается начать жить заново — рядом с ней муж, подрастает дочь, но всё, о чем она мечтает — это поскорее вернуться к работе. Такой шанс представляется, когда в городе происходит череда таинственных убийств. Есеня возвращается на службу и в первый же день снова теряет близкого человека, своего друга и напарника.\n\nЧтобы найти убийцу, ей необходим метод. Чтобы найти метод, ей необходимо воскресить в памяти все то, чему её учил Меглин. Поиски приводят Есеню к разгадке тайн прошлого. Героине, которая еще не успела оправиться от одного кошмара, приходится столкнуться с новым. Но что, если это её убьёт?');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (126, 'series','trailers/1.mp4','Чернобыль: Зона отчуждения',7.8,2014,'https://kinopoiskapiunofficial.tech/images/posters/kp/727157.jpg','True',16,'Пятеро молодых людей прыгают в старую «Волгу» и отправляются на поиски вора, часом ранее укравшего из квартиры родителей главного героя восемь миллионов рублей. Грабитель — обычный московский айтишник, — вместо того чтобы залечь на дно, тут же записывает видеоотчет, в котором сообщает, что финальная точка его путешествия — Чернобыльская АЭС и город Припять.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (127, 'series','trailers/1.mp4','Ивановы-Ивановы',7.7,2017,'https://kinopoiskapiunofficial.tech/images/posters/kp/1044102.jpg','True',16,'Порой родителям кажется, что их ребёнка подменили… а две семьи Ивановых с юга России в этом просто уверены: спустя 16 лет однофамильцы узнают, что их детей перепутали в роддоме. Как быть, если любимый сын на самом деле не родной, а твою кровиночку воспитывают чужие люди? Ещё и в роскоши, которая тебе даже не снилась. И как он примет своих новых, но уж больно бедных родственников?');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (128, 'series','trailers/1.mp4','Смешарики. Новый сезон',9.0,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1379016.jpg','True',0,'Истории о дружбе и приключениях обаятельных круглых героев. Весёлые и музыкальные, неожиданные и мечтательные, домашние и авантюрные. Целый мир в одной уютной Ромашковой долине.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (129, 'series','trailers/1.mp4','Оффлайн',7.8,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/1338345.jpg','True',18,'BeHappy — секретное невидимое приложение, которое служит для покупки наркотиков через смартфон. Его пользователи сталкиваются с серьезным противником, который прячется под именем Анонимус. Он сообщает им, что сумел раскрыть данные всех, кто когда-либо пользовался этим приложением и теперь он дает им выбор — пойти в полицию и во всем признаться или сыграть в игру со смертью. Что будет, если в этой игре проиграть, становится ясно, когда пользователи BeHappy получают фото кладмена с перерезанным горлом.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (130, 'series','trailers/1.mp4','Сказочный патруль',8.6,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/983091.jpg','False',0,'В первом сезоне три подруги — Варя, Маша и Снежка — приезжают в заповедник сказок — город Мышкин, где знакомятся с местной девочкой Аленкой. Пройдя ряд испытаний и преодолев разногласия, девочки становятся подругами. Вместе они создают команду для контроля за сказочными силами.\n\nВо втором сезоне Варя, Маша, Снежка и Аленка отправляются в Сказочный мир на поиски родителей Аленки. Там они встречают новую подругу — хранительницу времени Алису.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (131, 'series','trailers/1.mp4','Реальные пацаны',6.8,2010,'https://kinopoiskapiunofficial.tech/images/posters/kp/568082.jpg','True',16,'Обычный, рядовой российский парень Коля не может определиться между жизнью «на районе» и миром пермской элиты общества. На протяжении всего сериала его ждут увлекательные и смешные истории.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (132, 'series','trailers/1.mp4','Последний министр',7.4,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1236796.jpg','True',18,'Когда министром перспективного планирования назначают деятельного Евгения Тихомирова, никто представить не может, к чему это приведёт. Оказывается, новый министр действительно хочет изменить жизнь людей к лучшему и для этого вместе с командой активно продвигает собственные инициативы. Правда, инициативы эти не всегда разумны, а результат — крайне непредсказуем.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (133, 'series','trailers/1.mp4','Ми-ми-мишки',7.8,2015,'https://kinopoiskapiunofficial.tech/images/posters/kp/923524.jpg','False',0,'Веселые истории двух медвежат: Кеши и Белой Тучки. Вместе с героями этой веселой истории, дети будут познавать окружающий мир, знакомиться с самыми разнообразными предметами и тем, как они сделаны, ходить на рыбалку, лечить деревья, вести расследования, добывать мед, читать книжку и даже слетают на Луну!');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (134, 'series','trailers/1.mp4','Физрук',7.6,2014,'https://kinopoiskapiunofficial.tech/images/posters/kp/789914.jpg','True',16,'Это история о столкновении двух времен: «лихих» 90-х и «стабильных» десятых. Главный герой Фома всю жизнь был «правой рукой» влиятельного человека с полукриминальным прошлым. Когда «хозяин» выгнал его на пенсию, Фома решил любым способом вернуться обратно. Сначала казалось, что все будет просто: подобраться к ребенку бывшего босса, прогнуться, напомнить о себе и вернуться в дело. Но план Фомы рушится в первый же день. В школе ему приходится задержаться надолго. Попав в абсолютно незнакомый мир детей и учителей, который кардинально отличается от привычного ему круга, Фома не только меняет свою жизнь, но и меняется сам.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (135, 'series','trailers/1.mp4','Чики',7.7,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1312007.jpg','False',18,'Юг. Поля подсолнухов, шашлычный дымок, спелые арбузы, джигиты на лошадях и жигулях. У трассы в притоне нелегким трудом зарабатывают на жизнь три подруги – Света, Марина и Людка. Раньше их было четверо. Самая смелая и предприимчивая – Жанна – укатила в Москву и вернулась на красном MINI Cooper с идеей начать свой бизнес. Одна за другой подруги присоединяются к плану завязать с грязным прошлым. Это трудно и даже опасно, но оно точно того стоит.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (136, 'series','trailers/1.mp4','Русалки',7.1,2018,'https://kinopoiskapiunofficial.tech/images/posters/kp/1038292.jpg','False',18,'Размеренную жизнь провинциального города потрясает страшная новость: найдено тело 32-х летней женщины. Есть подозрение, что погибшая — сестра следователя местного ОВД Риты Тихоновой, пропавшая 14 лет назад. Начинается расследование, в ходе которого Рита сталкивается с весьма странными обстоятельствами и понимает, что её окружение хранит страшные тайны, а родные и друзья — не те, за кого себя выдают.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (137, 'series','trailers/1.mp4','Водоворот',7.3,2020,'https://kinopoiskapiunofficial.tech/images/posters/kp/1227993.jpg','False',18,'В городском коллекторе группа следователей обнаруживает убитых подростков, которых никто никогда не разыскивал. Раскручивая шаг за шагом это дело, полицейские сталкиваются лицом к лицу с безусловным злом — водоворотом большого города, который засасывает и уничтожает слабых — тех, кого никто не любит и не ждет дома. Зло безнаказанно уничтожает людей, и каждый из героев столкнется с ним лично, заглянет внутрь себя, чтобы встретиться с собственными демонами и страхами.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (138, 'series','trailers/1.mp4','Ольга',6.4,2016,'https://kinopoiskapiunofficial.tech/images/posters/kp/940680.jpg','True',16,'Главная героиня воспитывает двух детей от разных браков, заботится об отце-алкоголике и пытается наладить личную жизнь. Старшая дочь Анька учится в ПТУ, думает, что она единственный адекватный член семьи и в её жизни все будет по-другому, младший сын Тимофей, чей отец вернулся к первой семье в Азербайджан, считает, что он уже мужчина, хотя ему всего лишь 11 лет, отец Ольги, бывший футболист, крепко выпивает и постоянно врет, а сестра Ленка пытается жить за счет мужчин, в основном — женатых. Вечно спасая родственников от неприятностей, Ольга живет чужой жизнью и редко думает о себе – до тех пор, пока в нее не влюбляется молодой и положительный водитель газели «Ритуал» Гриша.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (139, 'series','trailers/1.mp4','Киллер',7.4,2022,'https://kinopoiskapiunofficial.tech/images/posters/kp/4456600.jpg','True',18,'Бывший полицейский Иван встречает в зале суда своего заклятого врага, шесть лет назад убившего его напарника, а затем отправившего его самого «за решётку». Того в очередной раз обвиняют в заказном убийстве, но изворотливый преступник снова выходит на свободу.\n\nВсе эти годы, проведённые в тюрьме, жажда мести пожирает Ивана изнутри. Но, встав на путь мщения, он сталкивается с очень опасными и влиятельными людьми. Теперь он вынужден заключить сделку «с дьяволом»: чтобы спасти собственную жизнь, он должен выполнить для них «заказ». Иван даёт своё согласие и становится наёмным убийцей — киллером. Но судьба вносит в его планы свои коррективы: Иван попадает в страшную аварию. Несколько недель врачи борются за его жизнь, главный герой выживает, но теряет память: он не помнит, кто он, кто его нанял и кого он должен убить. Он не помнит ничего и, таким образом, получает неожиданный шанс на новую жизнь.');
INSERT INTO content(id, type,trailer_url,title,rating,year,preview_url,is_free,age_limit,description) VALUES (140, 'series','trailers/1.mp4','Король и Шут',8.3,2023,'https://kinopoiskapiunofficial.tech/images/posters/kp/4647040.jpg','True',18,'Горшок, Князь и Шут — герои панк-сказки, в которой студенты реставрационного училища стали одной из главных рок-групп страны, собрали «Юбилейный», покорили Москву, выступили как хедлайнеры на фестивале «Нашествие» и создали целую фэнтези-вселенную. Группа вошла в историю, а тексты их песен ожили в мире-фантазии, где Горшок и Князь отправляются спасать принцессу из плена колдуна.');
