
Вскоре сынуля попадает в аварию и приходит в себя на деревенской конюшне. На дворе — Россия 1860 года, а сам он — бесправный конюх Гришка, которому за любую провинность и ослушание всегда готовы всыпать плетей, а то и вздёрнуть на глазах у всего честного народа.');

Летом 1944 года уже пытавшийся совершить несколько побегов Ивушкин попадет в концлагерь в Тюрингии. Там же оказывается и его «старый знакомый» Ягер, который решает использовать навыки Николая для тренировки немецких кадетов. Он распоряжается собрать тому команду и выдать только что прибывшую с фронта новую модель танка Т-34, не зная, что идею побега Ивушкин не оставил.');

Когда проигрыш означал поражение страны, когда нужно было выходить и бороться в раскаленной обстановке из-за произошедшего теракта, великий тренер сборной СССР был готов на все, лишь бы помочь своим подопечным разбить американский миф о непотопляемой команде мечты. Ведь он знал, что создал самую сильную сборную на планете, и в начале заставил поверить в это своих игроков, а затем весь мир.');

И еще. Из этих разговоров – это мы точно знаем – многие женщины узнают о себе очень много нового...');

История Людмилы Павличенко – легендарной снайперши. Солдаты шли в бой с ее именем на устах, а враги устроили на нее охоту. На поле битвы она видела смерть и страдания, но самым серьезным испытанием для нее стала любовь, которую у нее могла забрать война.');

И лишь тогда, когда в эту «милую» квартиру заезжает самостоятельная мама с очаровательной 8-летней дочерью Алиной, новые жильцы узнают, что жилплощадь их – непростая, а живет в ней самый настоящий Домовой. Только вот хранитель очага уже давно обиделся на весь род человеческий и сделает все вообразимые гадости, только бы остаться одному в злополучной квартире. Но всё меняется, когда Домовому бросает вызов злая колдунья…');

Ради достижения цели Генри готов на многое. Но позже оказывается, что не только он один является врагом Акана, у некоего Джимми свои планы на злодея. Теперь вместе ребятам предстоит спасти Эстель и даже сражаться с армией киборгов.');

Школьник Ваня Кузнецов был пустым местом всегда. Жертва гиперопеки матери, объект насмешек одноклассников, он боится даже заговорить с девочкой, в которую давно влюблен. У Юры есть неделя, чтобы закончить дело своей жизни и поднять самолет в воздух. Ваня — единственный, кто его видит и может ему помочь.');

Но сватать кобылу королевских кровей может только особа царских кровей.​ Юлий обращается к князю Киевскому за помощью, но получает отказ. Но наш жених не намерен отказываться от любви. Он похищает князя и насильно везет его к султану, на сватовство. И у богатырей​ тоже​ есть дело в восточной стороне. Все сойдутся на больших скачках, где победитель получит всё.');

Гущин начинает свою лётную жизнь сначала. Его наставник — командир воздушного судна — суровый и принципиальный Леонид Зинченко. Его коллега — второй пилот, неприступная красавица Александра. Отношения складываются непросто. Но на грани жизни и смерти, когда земля уходит из-под ног, вокруг — огонь и пепел, и только в небе есть спасение, Гущин показывает всё, на что он способен. Только вместе экипаж сможет совершить подвиг и спасти сотни жизней.');

Среди попавших в беду людей – врач городской больницы Андрей Гарин и его дочь Ксюша. Гарин сражается с катастрофой, пытаясь спасти оставшихся в живых пассажиров, в компании любовника своей жены. Гарину придется побороть обиду, гнев и страх. Он должен выжить, чтобы вернуть свою любовь, семью… свою прежнюю счастливую жизнь.');

Приказ отбить дом, захваченный противником, получает немецкий офицер Кан. На фоне одного из самых кровопролитных сражений в истории человечества разворачиваются истории любви и драматического противостояния характеров.');

Судьба свела их в Крыму близ древнего города Мангуп-Кале. Это была любовь с первого взгляда… В непростые дни исторических перемен они должны сохранить свою жизнь и любовь.');

Космонавты понимают, что шансов вернуться на Землю у них немного. Но этот рискованный путь — единственно возможный. Они должны не только проникнуть на «Салют-7», но и оживить его.');

Они пока не знают, что те другие, забаррикадировавшиеся в цехе — это местные рабочие во главе с бывшим спецназовцем по прозвищу Седой. Полгода без зарплаты и предстоящее банкротство завода толкнули их на отчаянный шаг.

Чтобы вытащить своего хозяина, «спецы» не остановятся ни перед чем. Но в отличие от них «работягам» больше нечего терять.');

Так начинает складываться портрет легендарного великого комбинатора и любимца женщин Остапа Бендера-Задунайского.');

Под бой курантов этих и новых героев «Ёлок» объединит бумеранг добра. Завершая свой круг, он заслуженно вернётся к каждому, кто его однажды запустил – кому улыбками и объятиями любимых и друзей, кому – праздничным настроением и соответствующим градусу состоянием, а кому-то… телефоном в холодце!');

В новогоднюю ночь все собираются у Саши дома, чтобы отпраздновать еще и его день рождения, ведь родился он 1 января. Оля приготовила ему подарок - он скоро станет папой! Чтобы хоть на какое-то время остаться наедине со своими мыслями, Саша прячется в туалете. Нажав на смыв, он оказывается... в квартире своих родителей за два часа до своего рождения. И на дворе 31 декабря 1992 года.');















